from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message

from stw_gen_sample3_api.types.core.service.types.status_type import Status


@dataclass
class TestResult(_Message):

    # Результат теста при использовании паттерна 0xFF
    _FFRes: Status
    # Результат теста при использовании паттерна 0xAA
    _AARes: Status
    # Результат теста при использовании паттерна 0x55
    _55Res: Status
    # Результат теста при использовании паттерна 0x00
    _00Res: Status
    # Результат теста при использовании паттерна последовательного счётчика
    _CounterRes: Status


class TestResultDict(TypedDict):

    # Результат теста при использовании паттерна 0xFF
    _FFRes: Union[Status]

    # Результат теста при использовании паттерна 0xAA
    _AARes: Union[Status]

    # Результат теста при использовании паттерна 0x55
    _55Res: Union[Status]

    # Результат теста при использовании паттерна 0x00
    _00Res: Union[Status]

    # Результат теста при использовании паттерна последовательного счётчика
    _CounterRes: Union[Status]

